using System.Reflection;

namespace ExercisesDAL
{
    public class PicsUtility
    {
        readonly Dictionary<string, string>? DictionaryStudents = new();

        public async Task<bool> AddStudentPicsToDb()
        {
            bool picsLoaded = true;
            try
            {
                LoadPicsToDictionary();
                SomeSchoolRepository<Student> repo = new();

                foreach (var studentEntry in DictionaryStudents!)
                {
                    Student? student = await repo.GetOne(stu => stu.LastName == studentEntry!.Key);

                    if (student is not null)
                    {
                        byte[] pic = Convert.FromBase64String(studentEntry.Value);

                        if (student.Picture is null || pic.Length != student.Picture!.Length) // different picture than the db?
                        {
                            student!.Picture = pic;
                            if (await repo.Update(student) != UpdateStatus.Ok)
                            {
                                picsLoaded = false; // update failed
                                break;
                            }
                        }
                    }
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine("Problem in " + MethodBase.GetCurrentMethod()!.Name + ex.Message);
            }
            return picsLoaded;
        }

        private void LoadPicsToDictionary()
        {
            // base 64 strings of pics
            DictionaryStudents!.Add("Cross", "");
            DictionaryStudents!.Add("Beard", "");
            DictionaryStudents!.Add("Brook", "");
            DictionaryStudents!.Add("Fish", "");
            DictionaryStudents!.Add("Pond", "");
            DictionaryStudents!.Add("Law", "");
            DictionaryStudents!.Add("Pott", "");
            DictionaryStudents!.Add("Disposition", "");
            DictionaryStudents!.Add("Amole", "");
            DictionaryStudents!.Add("Bee", "");
        }
    }
}
